import React from 'react';
import './index.css';
import Navbar from "./components/Navbar"

function App() {
  const [currentWeather, setCurrentWeather] = React.useState([])
  let fetchId = "908fdec828c4417d5f207702600d9589"
  let lat = "34.51"
  let lon = "-105.87"

  React.useEffect(() =>{
    fetch(`api.openweathermap.org/data/2.5/weather?lat=${lat}&lon=${lon}&appid=${fetchId}`, {
      headers: {
        'Content-type': 'application/json',
        'Accept': 'application/json'
      }
    })
    .then(res => res.json())
    .then(data => console.log(data))
  }, [])

  // console.log(currentWeather)

  return (
    <div className="App">
      <Navbar />
    </div>
  );
}

export default App;
